import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import Box from '@material-ui/core/Box';
import Paper from '@material-ui/core/Paper';
import ImageListItem from '@material-ui/core/ImageListItem';

async function getImages(){
    const rawResponse = await fetch('http://localhost:8085/api/v1/movies?page=1&limit=100',{
        method: 'GET'
    });
    if(rawResponse.ok){
        const images = await rawResponse.json();
        console.log(images);
    }

}


export default function UpcomingGrid() {
    return (
        <Box sx={{ flexGrow: 1 }}>
          <Grid container  >
            <Grid item xs={1}>
            <ImageListItem >
                    <img
                        src={`https://images.unsplash.com/photo-1516802273409-68526ee1bdd6?w=164&h=164&fit=crop&auto=format`}
                        
                    />
            </ImageListItem>
            </Grid>
            
          </Grid>
        </Box>
      );
    }
